import React, {useState} from 'react';
import Grid from '@mui/material/Unstable_Grid2/Grid2';
import ValueChanger from './ValueChanger';
import Button from '@mui/material/Button';

function ChannelChanger(props){
    const sendChange = (newValue) => {
        props.onValueChange(newValue);
    }
    const properties = props.value;
    console.log(properties);
    return(
        <Grid container spacing={1} sx={{borderLeft: 'solid 2px', px: 1}}>
            <Grid md={12}>
                <h3>Channel {props.channelNumber}</h3>
            </Grid>
            <Grid md={6}>
                <ValueChanger property={'name'} value={properties['name']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={6}>
                <ValueChanger property={'coupling'} value={properties['coupling']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={6}>
                <ValueChanger property={'bwLimit'} value={properties['bwLimit']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={6}>
                <ValueChanger property={'probe'} value={properties['probe']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={6}>
                <ValueChanger property={'tdiv'} value={properties['tdiv']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={6}>
                <ValueChanger property={'timeOffset'} value={properties['timeOffset']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={6}>
                <ValueChanger property={'vdiv'} value={properties['vdiv']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={6}>
                <ValueChanger property={'voltageOffset'} value={properties['voltageOffset']} keyHistory={[]} propertiesDB={props.propertiesDB} onValueChange={sendChange}></ValueChanger>
            </Grid>
            <Grid md={12}>
                <Button variant="contained" sx={{background: props.isActive ? 'green' : 'red'}}>
                    {props.isActive ? 'Active' : 'Inactive'}
                </Button>
            </Grid>
        </Grid>
    )
    
}


export default ChannelChanger;
